import React, { useState, useEffect } from 'react';

const BtnBbw = props => {
    
    const content = (
        <div className={props.width}>
            <button
                className="w-full h-12 bg-gray-900 hover:bg-gray-700 font-sans font-medium text-white text-sm py-2 px-4 mt-4 mb-4"
                type="button"
                value={props.txt}
                onClick={props.onClick}
            />
        </div>
    )

    return content
}

export default BtnBbw
